import './header.css';
import React from 'react';
//import Victoria from './IMG_0897.JPG';


class Gallery extends React.Component {
render() {
    return (
         <div className="container gallery-container" id="about">
            <h1 className="display-4" style={{textAlign: "center"}}>Portfolio</h1>
            <p className="page-description text-center">Click On Images To Enlarge</p>
            <div className="tz-gallery">
                <div className="row">
                    <div className="col-sm-6 col-md-4">
                        <div className="thumbnail">
                            <a className="lightbox" href={require('/assets/IMG_0897.JPG')}>
                                <img src={require('/assets/IMG_0897.JPG')} />
                            </a>
                            <div className="caption">
                                <h3>Victoria</h3>
                                <p>Kelly Drive, Philadelphia, PA</p>
                            </div>
                        </div>
                    </div>

                </div>
            </div>     
        </div>






    );
  }
}

export default Gallery;
